description:
In the 1960s, not only did Britain's dominance in pop music and the US's artistic response were major movements in the history of popular music, but it was also the time when Canada music scene began to come of age and make waves of its own, This film covers the history of the era and the major talents that arose from it who showed that their nation could have its own musical voice that can be successful in its own land.   &lt;a href=&quot;
